def minPath(grid, k):
    n = len(grid)
    visited = [[False] * n for _ in range(n)]
    path = []

    def dfs(x, y, k):
        if k == 0:
            return path

        visited[x][y] = True
        path.append(grid[x][y])

        dirs = [(0, 1), (1, 0), (0, -1), (-1, 0)]
        min_val = float('inf')
        for dx, dy in dirs:
            nx, ny = x + dx, y + dy
            if 0 <= nx < n and 0 <= ny < n and not visited[nx][ny]:
                min_val = min(min_val, grid[nx][ny])

        for dx, dy in dirs:
            nx, ny = x + dx, y + dy
            if 0 <= nx < n and 0 <= ny < n and not visited[nx][ny] and grid[nx][ny] == min_val:
                result = dfs(nx, ny, k - 1)
                if result:
                    return result

        path.pop()
        visited[x][y] = False
        return []

    for i in range(n):
        for j in range(n):
            if grid[i][j] == 1:
                result = dfs(i, j, k - 1)
                if result:
                    return result

